import "./App.css";

const Header = () => {
  return <div className="header"></div>;
};
const Navi = () => {
  return <div className="navi"></div>;
};
const Body = () => {
  return <div className="body">
    <div className="section"></div>;
  </div>;
};
const Footer = () => {
  return <div className="footer"></div>;
};
const Section = () => {
  return <div className="section"></div>;
};
const Side = () => {
  return <div className="side"></div>;
};

function App() {
  return (
    <div className="container">
      <Header />
      <Navi />
      <Body>
        <Section />
        <Side />
      </Body>
      <Footer />
    </div>
  );
}

export default App;
